export const Gridx= (source) => {
  return (
	  <table cellspacing="1" cellpading="1">
	    <tbody>
	      {source.map(heading => {
	      <tr>
	        <td>Ali</td>
	        <td>2021-11-05</td>
	        <td>2021-11-14</td>
	      </tr>
              })}
	    </tbody>
	  </table>
  );
}

//export default Gridx;

export default function Grid({source}) {
  return (
    <table>
        <thead>
            <tr>
            // header row
            </tr>
        </thead>
        <tbody>
	    {source.map((row, index) => {
     return <tr key={index}>
            1</tr>;
            })}
        </tbody>
    </table>
  );
}
